import Header from './Logo';
import Hero from './Hero';
import FoodCategories from './FoodCategories';
import FoodItems from './FoodItems';
import Footer from './Footer';

function App() {
  return (
    <div>
      <Header />
      <Hero />
      <FoodCategories />
      <FoodItems />
      <Footer />
    </div>
  );
}

export default App;
